package original;
import org.junit.Test;
import static org.junit.Assert.*;
import java.util.ArrayList;
import java.util.List;

public class CanArrangeTest {

    @Test
    public void testCanArrange() {
        List<Object> arr = new ArrayList<>();
        arr.add(1);
        arr.add(2);
        arr.add(3);
        arr.add(4);
        arr.add(5);

        int result = CanArrange.canArrange(arr);

        assertEquals(-1, result);
    }

    @Test
    public void testCanArrangeWithDescendingOrder() {
        List<Object> arr = new ArrayList<>();
        arr.add(5);
        arr.add(4);
        arr.add(3);
        arr.add(2);
        arr.add(1);

        int result = CanArrange.canArrange(arr);

        assertEquals(4, result);
    }

    @Test
    public void testCanArrangeWithMixedOrder() {
        List<Object> arr = new ArrayList<>();
        arr.add(1);
        arr.add(3);
        arr.add(2);
        arr.add(5);
        arr.add(4);

        int result = CanArrange.canArrange(arr);

        assertEquals(2, result);
    }

    @Test
    public void testCanArrangeWithEmptyList() {
        List<Object> arr = new ArrayList<>();

        int result = CanArrange.canArrange(arr);

        assertEquals(-1, result);
    }

    @Test
    public void testCanArrangeWithNonIntegerElements() {
        List<Object> arr = new ArrayList<>();
        arr.add(1);
        arr.add("2");
        arr.add(3);
        arr.add(4);
        arr.add(5);

        int result = CanArrange.canArrange(arr);

        assertEquals(-1, result);
    }
}
